Job Description:
SUMMARY: The Data Entry Associate updates, organizes and maintains accurate company data relating to purchasing, filing completed driver paperwork, monitor and track inbound/outbound shipments, assure driver has proper paperwork for each purchase order and other departmental information. This position works closely with Soli Customer Service Representatives, External Customers, Soli Sales Team, and Reports to Site Transportation Manager.
ESSENTIAL FUNCTIONS: Nonessential Functions are preceded by an *)
Maintain purchasing information using the computer and paper files;
Key daily production levels for reporting and historical purposes;
Maintain and update accurate product inventory list;
Process orders and invoices using Sage 100 system;
